import React from "react";
import PropTypes from "prop-types";
import { withStyles, createMuiTheme } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import { NavLink } from "react-router-dom";
import { MuiThemeProvider } from "@material-ui/core/styles";
import OpenMenuBurger from "./OpenMenuBurger";

const styles = {
  root: {
    flexGrow: 1
  },
  grow: {
    flexGrow: 1
  },
  menuButton: {
    marginLeft: -12,
    marginRight: 20
  }
};

const ButtonAppBar = props => {
  const { classes } = props;
  //   const { search, myOffers } = this.props;
  return (
    <MuiThemeProvider theme={theme}>
      <div className={classes.root}>
        <AppBar position="static">
          <Toolbar>
            <OpenMenuBurger
              openSearch={props.search}
              openMyOffers={props.myOffers}
            />

            <div className="menu-desktop">
              <div className="bloc-logo">
                <NavLink className="logo link-desktop" to="/">
                  <div className="logo-element logo-name">ONE TEAM</div>
                </NavLink>
              </div>
            </div>
          </Toolbar>
        </AppBar>
      </div>
    </MuiThemeProvider>
  );
};
const theme = createMuiTheme({
  overrides: {
    MuiToolbar: {
      root: {
        backgroundColor: "white"
      }
    }
  }
});

ButtonAppBar.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(ButtonAppBar);
